import Header from './components/Header'
import RouteFile from './components/RouteFile'
import Footer from './components/Footer'

import { BrowserRouter, Route,  Switch } from 'react-router-dom'

class App extends Component {
  render() {
    return (
        <div >
          <Header />
          <RouteFile />
          <Footer />
        </div>

    );
  }
}

export default App;
